import config from '~/config';
import classNames from 'classnames/bind';
import styles from './Sidebar.module.scss';
import Menu, { MenuItems } from './Menu';
import { HomeActiveIcon, UserGroupIcon, LiveIcon } from '~/components/icons';
const cx = classNames.bind(styles);

function Sidebar() {
    return (
        <aside className={cx('wrapper')}>
            <Menu>
                <MenuItems title="For You" to={config.routes.home} icon={<HomeActiveIcon />} />
                <MenuItems title="Following" to={config.routes.following} icon={<UserGroupIcon />} />
                <MenuItems title="Live" to={config.routes.live} icon={<LiveIcon />} />
            </Menu>
        </aside>
    );
}

export default Sidebar;
